function print(definitions, minInputLength, minTargetLength) {
  let _redirects = "";
  for (let i = 0; i < definitions.length; i++) {
    let definition = definitions[i];
    let inputSpaces = minInputLength - definition.input.length + 4;
    let targetSpaces = minTargetLength - definition.target.length + 4;
    _redirects += (i === 0 ? "" : "\n") + definition.input + " ".repeat(inputSpaces) + definition.target + " ".repeat(Math.abs(targetSpaces)) + definition.status;
  }
  return _redirects;
}
export {
  print
};
